Mas para o Sylvinho está ótimo.

 @cadaxibin9597  Menos amigo! No time do Tite os laterais subiam muito,  por isso Jorge Henrique e Sheik desciam para ajudá-los acompanhando o s laterais adversário. 
O Jorge Henrique não era um Willian da vida né!? Duvido que o Tite colocaria o Willian para marcar descida de lateral. Willian nunca jogou assim em lugar nenhum! 
E outra, os laterais do Tite jogavam avançados cruzando as linhas até o fundo. Coisa que o Sylvinho não sabe fazer, ele matou o futebol do Fagner, limitado o Fagner do meio campo para traz.

 @eliasvictor7871  sim cara,o Hulk no começo tava osso.
Ainda bem q agora ele tá jogando muito.
Cara,vou te mandar a real, esse projeto q o Corinthians tá montando é pro ano q vem,esse ano o Corinthians pode conseguir uma vaga na libertadores,mas o bicho vai pegar ano q vem
